(()=>{"use strict";const e=new class{constructor(e,n){this.headerTitle=e,this.headerText=n}}("My Lunch Generator","What should I have for lunch today?");let n=[["Sushi","./img/sushi.jpg"],["Dango","./img/dango.jpg"],["Gyoza","./img/gyoza.jpg"],["Okonomiyaki","./img/okonomiyaki.jpg"],["Onigiri","./img/onigiri.jpg"],["Sashimi","./img/sashimi.jpg"],["Shoyu Ramen","./img/shoyu-ramen.jpg"],["Shrimp Tempura","./img/shrimp-tempura.jpg"],["Tonkatsu","./img/tonkatsu.jpg"],["Udon","./img/udon.jpeg"]];const i=n[Math.floor(Math.random()*n.length)],t=new class{constructor(e,n){this.name=e,this.img=n}showResult(){document.getElementById("name").innerHTML=i[0],document.getElementById("image").src=i[1],console.log(i[1])}}(i[0],i[1]);new class{constructor(){this.renderTemplate(),t.showResult()}renderTemplate(){const n=`\n      <header>\n        <h1>${e.headerTitle}</h1>\n        <p>${e.headerText}</p>\n      </header> \n      <main>\n      <h2 id="name">${t.name}</h2>\n      <img id="image" src="${t.img}">\n      </main>     \n        `;document.body.innerHTML=n}}})();